import React, { useState } from "react";
import { Card, Row, Col } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faSearch } from "@fortawesome/free-solid-svg-icons";
import Sidebar from "../common/Sidebar.jsx";
import TopNavbar from "../common/Navbar.jsx";
import PendingUsers from "../users/PendingUsers.jsx";
import ContainerSlot from "../container/ContainerSlot.jsx";
import ContainerStatus from "../container/Containers.jsx";


const AdminDashboard = () => {
  const [collapsed, setCollapsed] = useState(false);

  const toggleSidebar = () => {
    setCollapsed(!collapsed);
  };

  return (
    <div style={{ display: "flex", background: "#232536", minHeight: "100vh" }}>
     
      <Sidebar collapsed={collapsed} toggleSidebar={toggleSidebar} />

      {/* Main Content */}
      <div
        style={{
          flexGrow: 1,
          marginLeft: collapsed ? "80px" : "250px", // adjust based on your sidebar width
          transition: "margin-left 0.3s ease",
          padding: "36px 30px 0 30px",
        }}
      >
        <TopNavbar />
        
        <h3 className="m-4 text-white">Dashboard</h3>

        <form>
          <div className="input-group mb-4 ">
            <input
              type="text"
              className="form-control"
              placeholder="Search item..."
            />
            <span className="input-group-text">
              <FontAwesomeIcon icon={faSearch} />
            </span>
          </div>
        </form>
         <div className="mb-4">
          <PendingUsers/>
         </div>
        <Row className="g-3 mb-4">
          <Col md={3}>
            <Card className="p-3 text-center bg-dark border-0 shadow-sm border border-secondary">
              <h5 className="text-white-50">Total Containers</h5>
              <div className="display-6 text-white">
                <span>3</span> x 12
              </div>
            </Card>
          </Col>
          <Col md={3}>
            <Card className="p-3 text-center bg-dark border-0 shadow-sm">
              <h5 className="text-white-50">Total Slots</h5>
              <div className="display-6 text-white">36</div>
            </Card>
          </Col>
          <Col md={3}>
            <Card className="p-3 text-center bg-dark border-0 shadow-sm">
              <h5 className="text-white-50">Occupied</h5>
              <div className="display-6 text-white">43</div>
            </Card>
          </Col>
          <Col md={3}>
            <Card className="p-3 text-center bg-dark border-0 shadow-sm">
              <h5 className="text-white-50">Pending Approvals</h5>
              <div className="display-6 text-white">2</div>
            </Card>
          </Col>
        </Row>
        
        <div>
          <ContainerStatus/>
        </div>
        <div>
          <ContainerDetails/>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
